--
-- Name: balance_history_view; Type: VIEW; Schema: finapp; Owner: finapp_user
--

CREATE VIEW finapp.balance_history_view AS
 SELECT bh.id,
    bh.position_id,
    p.portfolio_id,
    a.name AS asset_name,
    a.symbol AS asset_symbol,
    bh.balance,
    bh.previous_balance,
    bh.change_amount,
    bh.change_type,
    bh.update_date,
    bh.update_time,
    bh.notes,
    u.email AS updated_by_email,
    bh.created_at,
    bh.updated_at,
        CASE
            WHEN ((bh.previous_balance IS NOT NULL) AND (bh.previous_balance > (0)::numeric)) THEN ((bh.change_amount / bh.previous_balance) * (100)::numeric)
            ELSE (0)::numeric
        END AS return_percentage
   FROM (((finapp.balance_history bh
     JOIN finapp.positions p ON ((bh.position_id = p.id)))
     JOIN finapp.assets a ON ((p.asset_id = a.id)))
     LEFT JOIN finapp.users u ON ((bh.created_by = u.id)))
  ORDER BY bh.update_date DESC, bh.update_time DESC;


