--
-- Name: wealth_products_summary; Type: VIEW; Schema: public; Owner: caojun
--

CREATE VIEW public.wealth_products_summary AS
 SELECT p.id,
    p.portfolio_id,
    p.trading_account_id,
    a.name AS product_name,
    a.symbol AS product_code,
    p.product_mode,
        CASE
            WHEN ((p.product_mode)::text = 'QUANTITY'::text) THEN (p.quantity * COALESCE(p.net_asset_value, p.average_cost))
            WHEN ((p.product_mode)::text = 'BALANCE'::text) THEN p.balance
            ELSE (0)::numeric
        END AS current_value,
        CASE
            WHEN ((p.product_mode)::text = 'QUANTITY'::text) THEN ((p.quantity * COALESCE(p.net_asset_value, p.average_cost)) - p.total_cost)
            WHEN ((p.product_mode)::text = 'BALANCE'::text) THEN (p.balance - p.total_cost)
            ELSE (0)::numeric
        END AS unrealized_pnl,
    p.quantity,
    p.net_asset_value,
    p.balance,
    p.total_cost,
    p.currency,
    p.last_nav_update,
    p.first_purchase_date,
    p.last_transaction_date,
    ta.name AS account_name,
    at.category AS asset_category
   FROM (((public.positions p
     JOIN public.assets a ON ((p.asset_id = a.id)))
     JOIN public.asset_types at ON ((a.asset_type_id = at.id)))
     JOIN public.trading_accounts ta ON ((p.trading_account_id = ta.id)))
  WHERE (((p.is_active = true) AND ((at.category)::text = ANY ((ARRAY['wealth'::character varying, 'cash'::character varying])::text[])) AND (p.quantity > (0)::numeric)) OR (p.balance > (0)::numeric));


ALTER TABLE public.wealth_products_summary OWNER TO caojun;

--
-- Name: VIEW wealth_products_summary; Type: COMMENT; Schema: public; Owner: caojun
--

COMMENT ON VIEW public.wealth_products_summary IS '理财产品汇总视图，支持净值型和余额型产品';


